response.about:
Я:
- птица, а значит, умею летать;
- люблю мою Машу и это взаимно;
- обожаю смотреть летом в окно на весёлых ласточек;
- учусь хорошо говорить;
- люблю играть с бубенчиками;
- люблю, когда Маша поёт;
- люблю, когда светит солнышко.
И я боюсь:
- папыного голоса:
- кошки Виты;
- веника;
- чёных перчаток, которые ловят меня и загоняют в клетку.
Я не люблю:
- оставаться дома один;
- кога погода не очень;
- когда мне говорят идти домой;
- или когда со мной вообще не говорят!
